import './App.css';
import { Routes, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import NavBar1 from './components/navbar';
import Landing from './Landing';


function App() {
  return (
    <div className="App">
      <NavBar1></NavBar1>
      <Routes>
        <Route path='/' element={<Landing/>} />
      </Routes>
    </div>
  );
}

export default App;
